import React, { Component } from 'react';
import data from "./data"; 
import "../stylesheets/Navigation.css"

class Navigation extends Component {
    render() {
        return (
            <nav class="nav-side-menu">
                <div class="navbar-nav">

                <a class="nav-brand" href="#">
                    <img src="https://i.ibb.co/VSnBN2v/whale.png" alt="whale" border="0" />
                </a>

                <a class="nav-item nav-link" href="#">
                    <img src="https://i.ibb.co/Bgd4Q0T/message.png" alt="message" border="0" /></a>
                <a class="nav-item nav-link active" href="#">Teams</a>
                <a class="nav-item nav-link" href="#">
                    <img src="https://i.ibb.co/0V5c46r/profile.png" alt="message" border="0" /></a>
                <a class="nav-item nav-link" href="#">
                <img src="https://i.ibb.co/hMy6HKk/stats.png" alt="message" border="0" /></a>
                <a class="nav-item nav-link" href="#" style={{position: "absolute", bottom: "0"}} >Help</a>
                </div>
            </nav>
        );
    }
}

export default Navigation;
